#include<bits/stdc++.h>
using namespace std;
#define ll long long
long long int factorial(const int n)
{
    long f = 1;
    for (int i = 1; i <= n; ++i)
        f += i;
    return f;
}
class Solution
{
public:
    int countHomogenous(string s)
    {
       s=s+'0'; 
        // cout<<s<<endl;
        int temp=0;
        map<char,int> m;
        int cnt=0;
        char ch=s[0];

        for (int i = 0; i < s.length(); i++)
        {
            m[s[i]]++;
            if(ch!=s[i])
            {
                if(s[i]==s[i+1])
                {
                    continue;
                }
                cout<<m[ch]<<endl;
                cnt+=factorial(m[ch]);
                cnt--;
                m[ch]=0;
                ch=s[i];
            }
        }
       return cnt; 
    }
};
int main()
{
     Solution s;
     string str = "";
     cout << s.countHomogenous(str);
     return 0;
}